        tau4(i) = theta4*psi4 + (min_noise_torque + (max_noise_torque-min_noise_torque)*rand(1))/10;
        tau5(i) = theta5*psi5 + (min_noise_torque + (max_noise_torque-min_noise_torque)*rand(1))/10;
        tau6(i) = theta6*psi6 + (min_noise_torque + (max_noise_torque-min_noise_torque)*rand(1))/10;
    end
    Tau = [tau1;tau2;tau3;tau4;tau5;tau6];
end    